func (_Storage *StorageFilterer) ParseResultAdded(log types.Log) (*StorageResultAdded, error) {
	event := new(StorageResultAdded)
	if err := _Storage.contract.UnpackLog(event, "ResultAdded", log); err != nil {
		return nil, err
	}
	event.Raw = log
	return event, nil
}
